window.bookSummaryJSON = "<p><b>She needs money. I need her.</b></p> <p>They say I'm jealous. Possessive. Obsessed.</p> <p>I say I know what I want, and I want her.</p> <p>She'll be my submissive. My property. I'll teach her what it means to submit. I'll show her what it means to obey.</p> <p>So I hire her for a job. To be my accomplice. We'll pull off the biggest heist known to Corsica.</p> <p>They say money doesn't buy loveâ€¦</p> <p>But it can buy her.</p> <p>Own Me <i>is a standalone novel in Jane Henry's new series, Masters of Corsica. This is a dark, anti-hero romance with elements of violence and consensual non-consent. For mature listeners.</i></p>"; 
